import React from 'react';
import './navbar.css';

function Navbar() {
   return (
<header class="navbar">
<div class="navbar-content">
   <div class="logo">
      Logo
   </div>
   <div class="navbar-text">
      <p>Product</p>
      <p>Features</p>
      <p>Marketplace</p>
      <p class="navbar-text-two">Company</p>
      <p class="navbar-text-two">Log-in</p>
   </div>
</div>
</header>
 )}

export default Navbar;
